import React, { Component } from 'react';

const NewsList = (props) => {

    const items = props.news.map((item) => {
        return (
            <div>
                <h3>{item.title}</h3>
            </div>
        );
    });

    return (
        <div>
            items
        </div>
    )
}


export default NewsList;
